import React from 'react'
import { SliderData } from './SliderData'

const Slidero = () => {
    return (
        <>
            {SliderData.map((slide,index) =>{
                return (
                    <video src={slide.video} alt='Videos' />
                )
            })}
        </>
    )
}

export default Slidero
